import React from 'react';
import { Container, Row, Col, Image } from 'react-bootstrap';
import Portrait from '../assets/images/RTPortrait.png';

const Splash = () => {
  return (
    <Row>
        <Col xxl={6} xl={6} lg={6}>
            <Container>
                <h1>Welcome to my site!</h1>
            </Container>
        </Col>
        <Col xxl={6} xl={6} lg={6}>
            <Image fluid={true} src={Portrait} />
        </Col>
    </Row>
  )
}

export default Splash
